import "./Form.css";
function Form() {
  const services = [
    "Стрижка для мальчика",
    "Стрижка для девочки",
    "Бритье под ноль",
    "Стрижка челки для девочки",
    "Прокалывание мочек ушей Inverness",
    "Брейды с канекалоном/без канекалона",
    "3Д косы с канекалоном",
  ];

  return (
    <form className="feed-form" action="">
      <div className="feed-form__text">Записаться онлайн</div>
      <p className="feed-form__name">Имя ребенка</p>
      <input type="text" placeholder="Имя" name="name" />
      <p className="feed-form__phone">Телефон</p>
      <input type="text" placeholder="Телефон" name="phone" />
      <select className="feed-form__services" name="" id="">
        {services.map((item) => {
          return <option value="">{items}</option>;
        })}
      </select>
    </form>
  );
}

export default Form;
